import React, { Fragment } from 'react';
import AppMap from './Appmap';

const AppPass = (props) => {
    console.log(props.TodoPass);
    return (
        <Fragment>
          <h3>Todo Test Todo App</h3>
          {
                         props.TodoPass.map((todo) => (
                             <AppMap
                             key={todo.id} 
                             todoapp={todo.todo} 
                             id={todo.id} 
                             onRemoveItem={props.onRemoveTodo}
                             />
                         ))}
        
        </Fragment>
    );
};
export default AppPass;
